Insert into ANAVADA.FAQ (FAQ_NO,FAQ_ID,FAQ_TITLE,FAQ_CONTENT,FAQ_DATE,FAQ_COUNT,FAQ_CATEGORY) values (1,'admin','중고거래는 어떤 방식인가요?','저희는 직거래 방식을 추구하고 있습니다.',to_date('20/06/30','RR/MM/DD'),5,2);
Insert into ANAVADA.FAQ (FAQ_NO,FAQ_ID,FAQ_TITLE,FAQ_CONTENT,FAQ_DATE,FAQ_COUNT,FAQ_CATEGORY) values (2,'admin','로그인은 어떻게 하나요?','오른쪽 상단 위에 로그인 버튼을 눌러주세요~',to_date('20/07/01','RR/MM/DD'),3,1);
Insert into ANAVADA.FAQ (FAQ_NO,FAQ_ID,FAQ_TITLE,FAQ_CONTENT,FAQ_DATE,FAQ_COUNT,FAQ_CATEGORY) values (3,'admin','로그아웃은 어떻게 하나요?','오른쪽 상단 위에 로그아웃 버튼을 눌러주세요~',to_date('20/07/03','RR/MM/DD'),1,1);
Insert into ANAVADA.FAQ (FAQ_NO,FAQ_ID,FAQ_TITLE,FAQ_CONTENT,FAQ_DATE,FAQ_COUNT,FAQ_CATEGORY) values (4,'admin','탈퇴는 어떻게 하나요?','회원정보수정페이지에서 탈퇴하기 버튼을 눌러주세요.',to_date('20/07/03','RR/MM/DD'),6,1);
Insert into ANAVADA.FAQ (FAQ_NO,FAQ_ID,FAQ_TITLE,FAQ_CONTENT,FAQ_DATE,FAQ_COUNT,FAQ_CATEGORY) values (5,'admin','내정보는 어떻게 수정하나요','회원정보수정페이지에서 수정하기 버튼을 눌러주세요.',to_date('20/07/05','RR/MM/DD'),10,1);
Insert into ANAVADA.FAQ (FAQ_NO,FAQ_ID,FAQ_TITLE,FAQ_CONTENT,FAQ_DATE,FAQ_COUNT,FAQ_CATEGORY) values (6,'admin','중고거래 시 사기 피해를 당했을 때','고객센터(02-999-8888)을 이용해 주시거나 문의하기 게시판에 사기 아이디와 게시물 내용을 올려주세요.',to_date('20/07/07','RR/MM/DD'),5,2);
Insert into ANAVADA.FAQ (FAQ_NO,FAQ_ID,FAQ_TITLE,FAQ_CONTENT,FAQ_DATE,FAQ_COUNT,FAQ_CATEGORY) values (7,'admin','커뮤니티에 부적절한 글을 올립니다.','고객센터(02-999-8888)을 이용해 주시거나 문의하기 게시판에 사기 아이디와 게시물 내용을 올려주세요. 그 즉시 저희가 처리하겠습니다.',to_date('20/07/10','RR/MM/DD'),3,3);
Insert into ANAVADA.FAQ (FAQ_NO,FAQ_ID,FAQ_TITLE,FAQ_CONTENT,FAQ_DATE,FAQ_COUNT,FAQ_CATEGORY) values (8,'admin','커뮤니티에서의 판매글 가능한가요','저희 사이트에서는 커뮤니티의 판매글을 허용하지 않습니다. 커뮤니티에서는 이웃들간의 정보교환을 위주로 활동해주세요^^',to_date('20/07/11','RR/MM/DD'),1,3);
Insert into ANAVADA.FAQ (FAQ_NO,FAQ_ID,FAQ_TITLE,FAQ_CONTENT,FAQ_DATE,FAQ_COUNT,FAQ_CATEGORY) values (9,'admin','지역축제의 정보는 무엇인가요?','이번년도에 대한 축제정보를 제공하고 있습니다.',to_date('20/07/13','RR/MM/DD'),6,4);
Insert into ANAVADA.FAQ (FAQ_NO,FAQ_ID,FAQ_TITLE,FAQ_CONTENT,FAQ_DATE,FAQ_COUNT,FAQ_CATEGORY) values (10,'admin','지역축제 이용방법을 모르겠어요','지역축제 게시판은 이번년도에 대한 축제 ',to_date('20/07/20','RR/MM/DD'),10,4);
Insert into ANAVADA.FAQ (FAQ_NO,FAQ_ID,FAQ_TITLE,FAQ_CONTENT,FAQ_DATE,FAQ_COUNT,FAQ_CATEGORY) values (11,'admin','중고거래 반품을 원합니다.','죄송합니다. 저희는 회원간의 중고거래에 개입을 하지 못합니다. 하지만 중고거래 시 피해를 입으셨다면 언제든지 고객센터(02-999-8888)을 이용해 주시거나 문의하기 게시판에 사기 아이디와 게시물 내용을 올려주세요.',to_date('20/07/23','RR/MM/DD'),5,2);
Insert into ANAVADA.FAQ (FAQ_NO,FAQ_ID,FAQ_TITLE,FAQ_CONTENT,FAQ_DATE,FAQ_COUNT,FAQ_CATEGORY) values (12,'admin','커뮤니티 이용자 자격이 있나요?','저희 사이트는 오픈 사이트입니다. 기본적인 예의만 지켜주시면 누구나 이용하실 수 있습니다.',to_date('20/07/24','RR/MM/DD'),3,3);
Insert into ANAVADA.FAQ (FAQ_NO,FAQ_ID,FAQ_TITLE,FAQ_CONTENT,FAQ_DATE,FAQ_COUNT,FAQ_CATEGORY) values (13,'admin','커뮤니티에 반복글이 올라옵니다.','저희는 반복글도 제한합니다. 고객센터(02-999-8888)을 이용해 주시거나 문의하기 게시판에 아이디와 게시물 내용을 올려주세요.',to_date('20/07/12','RR/MM/DD'),1,3);
