Insert into ANAVADA.NOTICE (NO_NO,NO_ID,NO_TITLE,NO_CONTENT,NO_DATE,NO_COUNT,NO_ORIGINAL,NO_RENAME) values (1,'admin','공지사항 오픈입니다.','공지사항이 드디어 오픈했습니다. 많이 이용해주세요~',to_date('20/06/30','RR/MM/DD'),5,null,null);
Insert into ANAVADA.NOTICE (NO_NO,NO_ID,NO_TITLE,NO_CONTENT,NO_DATE,NO_COUNT,NO_ORIGINAL,NO_RENAME) values (2,'admin','중고거래 주의사항입니다.','중고거래할 때 주의해주세요~ 중고거래 시 사기를 당하셨을 경우 문의페이지에서 신고하실 수 있습니다.',to_date('20/07/01','RR/MM/DD'),3,null,null);
Insert into ANAVADA.NOTICE (NO_NO,NO_ID,NO_TITLE,NO_CONTENT,NO_DATE,NO_COUNT,NO_ORIGINAL,NO_RENAME) values (3,'admin','커뮤니티에 욕은 금지입니다.','커뮤니티에 글을 올릴 때 욕은 금지입니다~ 욕을 포함한 게시물 발견 시 신고해주세요.',to_date('20/07/03','RR/MM/DD'),1,null,null);
Insert into ANAVADA.NOTICE (NO_NO,NO_ID,NO_TITLE,NO_CONTENT,NO_DATE,NO_COUNT,NO_ORIGINAL,NO_RENAME) values (4,'admin','블랙리스트관리 중입니다.','신고를 당하면 블랙리스트에 올려질 수 있습니다. 주의해주세요',to_date('20/07/03','RR/MM/DD'),6,null,null);
Insert into ANAVADA.NOTICE (NO_NO,NO_ID,NO_TITLE,NO_CONTENT,NO_DATE,NO_COUNT,NO_ORIGINAL,NO_RENAME) values (5,'admin','로그인제한에 대한 글입니다.','블랙리스트에 올려지면 로그인 제한이 있을 수 있습니다. 로그인 제한에 대한 글은 고객센터로 연락주세요.',to_date('20/07/05','RR/MM/DD'),11,null,null);
Insert into ANAVADA.NOTICE (NO_NO,NO_ID,NO_TITLE,NO_CONTENT,NO_DATE,NO_COUNT,NO_ORIGINAL,NO_RENAME) values (6,'admin','기본적인 예의를 지켜주세요.','저희 사이트는 이웃간의 소통을 목표로 하고 있습니다. 그러므로 기본적인 예의를 서로 지켜주세요~',to_date('20/07/07','RR/MM/DD'),5,null,null);
Insert into ANAVADA.NOTICE (NO_NO,NO_ID,NO_TITLE,NO_CONTENT,NO_DATE,NO_COUNT,NO_ORIGINAL,NO_RENAME) values (7,'admin','고객센터를 이용하실 수 있습니다.','고객센터(02-999-8888)로 전화주시면 불편사항을 해결해드립니다.',to_date('20/07/10','RR/MM/DD'),3,null,null);
Insert into ANAVADA.NOTICE (NO_NO,NO_ID,NO_TITLE,NO_CONTENT,NO_DATE,NO_COUNT,NO_ORIGINAL,NO_RENAME) values (8,'admin','축제에 대한 문의도 환영입니다.','지역축제 게시판도 많이 이용해 주세요~ 감사합니다~',to_date('20/07/11','RR/MM/DD'),1,null,null);
Insert into ANAVADA.NOTICE (NO_NO,NO_ID,NO_TITLE,NO_CONTENT,NO_DATE,NO_COUNT,NO_ORIGINAL,NO_RENAME) values (9,'admin','신고하기 이용 시 주의사항입니다.','신고당한 이용자는 블랙리스트에 올려지면 몇번의 신고 후에는 로그인 제한이 걸립니다.',to_date('20/07/13','RR/MM/DD'),6,null,null);
Insert into ANAVADA.NOTICE (NO_NO,NO_ID,NO_TITLE,NO_CONTENT,NO_DATE,NO_COUNT,NO_ORIGINAL,NO_RENAME) values (10,'admin','[이용자필독]거래 시 주의할 점','중고 거래 사기 피해 신고가 줄질 않고 있습니다. 신고를 많이 받은 이용자에게는 불이익이 있을 예정이니 주의해주세요.',to_date('20/07/20','RR/MM/DD'),12,null,null);
Insert into ANAVADA.NOTICE (NO_NO,NO_ID,NO_TITLE,NO_CONTENT,NO_DATE,NO_COUNT,NO_ORIGINAL,NO_RENAME) values (11,'admin','친목활동','커뮤니티에 동아리나 친목활동이 활성화되고 있습니다. 서로 예의있게 행동해주세요~ 혹시모를 피해 신고는 고객센터(02-999-8888) 혹은 문의하기 게시판을 이용해주세요~',to_date('20/07/25','RR/MM/DD'),5,null,null);
Insert into ANAVADA.NOTICE (NO_NO,NO_ID,NO_TITLE,NO_CONTENT,NO_DATE,NO_COUNT,NO_ORIGINAL,NO_RENAME) values (12,'admin','축제정보에 대한 문의글','축제정보에 대한 문의글은 지역축제 게시판에 있는 담당번호를 이용하시거나 고객센터(02-999-8888) 혹은 문의하기 게시판을 이용해주세요~',to_date('20/07/26','RR/MM/DD'),3,null,null);
Insert into ANAVADA.NOTICE (NO_NO,NO_ID,NO_TITLE,NO_CONTENT,NO_DATE,NO_COUNT,NO_ORIGINAL,NO_RENAME) values (13,'admin','커뮤니티에서의 판매글은 삭제예정','커뮤니티에서의 판매글은 삭제예정입니다. 중고거래 게시판을 이용해 주세요. 잦은 판매글도 신고대상이 될 수 있습니다.',to_date('20/07/24','RR/MM/DD'),1,null,null);
Insert into ANAVADA.NOTICE (NO_NO,NO_ID,NO_TITLE,NO_CONTENT,NO_DATE,NO_COUNT,NO_ORIGINAL,NO_RENAME) values (14,'admin','고객센터 이용자 폭주','고객센터 이용자가 폭주하고 있습니다. 문의하기 게시판을 많이 활용해주세요.',to_date('20/07/27','RR/MM/DD'),7,null,null);
Insert into ANAVADA.NOTICE (NO_NO,NO_ID,NO_TITLE,NO_CONTENT,NO_DATE,NO_COUNT,NO_ORIGINAL,NO_RENAME) values (15,'admin','FAQ도 많이 이용해주세요','FAQ에 적혀있음 좋겠다 싶은 내용도 많은 의견 주세요~',to_date('20/07/30','RR/MM/DD'),10,null,null);
